  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Aleutian Islands
  National Wildlife Refuge outlines Refuge accomplishments from January through December
  of 1945. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
  predators, rodents, and mammals- is also covered. Resource management is outlined;
  topics include fur harvesting. The public relations section of the report describes
  recreational uses, Refuge visitors, and hunting. Items of interest are attached\",\n\t\"owner_org\":
